import React, { useState } from "react";
import "./App.css";
import { InputGroup, Input, Button } from "reactstrap";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { input: "", entries: "" };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(event) {
    const serverUrl = "http://localhost:5000";
    if (event.target.id == "read") {
      fetch(serverUrl + "/read/all", { method: "GET" }).then((response) => {
        return response.json().then((object) => {
          this.setState({
            entries: Object.entries(object),
          });
        });
      });
    } else if (event.target.id == "read") {
      console.log("test");
    }
  }

  handleKeys(event) {
    this.setState({ input: event });
    console.log(this.state.input);
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <ul>
            {Object.entries(this.state.entries).map(([key, value]) => (
              <li>
                <span>
                  {Object.values(this.state.entries[key][0])}:
                  {Object.keys(this.state.entries[key][1])[0]},
                  {Object.values(this.state.entries[key][1])}
                </span>
              </li>
            ))}
          </ul>
          <Input
            placeholder="#"
            onChange={(event) => this.handleKeys(event.target.value)}
            style={{ width: "50px" }}
          />
          <p>{this.state.input}</p>
          <Button color="success" onClick={this.handleClick} id="read">
            read
          </Button>
        </header>
      </div>
    );
  }
}

export default App;
